import React, { Fragment } from 'react'
import Homepage from './components/Homepage'
import Navbar from './components/Navbar';
import Form from './components/Form';
import menufiliere from './components/menufiliere';

function App() {
  return (
    <Fragment>
      <Navbar />
        <menufiliere.js />
      {/* <Homepage /> */}
      { <Form /> }
    </Fragment>
  )
}

export default App;
